import React, { useState, useEffect } from "react";
import axios from "axios";

function Analysis() {
  const [response, setResponse] = useState(null);

  const getResults = async () => {
    try {
      const response = await axios.get("http://localhost:5000/analysis");
      console.log(response.data);
      setResponse(response.data); // Set the response state with the data
    } catch (error) {
      alert('Logging Error: ' + error.response.data.error);
    }
  };

  useEffect(() => {
    getResults();
  }, []);

  return (
    <div style={{ height: "80vh" }}>
      <h1>All Results</h1>
      {response && (
        <table>
          <thead>
            <tr>
              <th></th>
              <th>Temperature</th>
              <th>Time Stamp</th>
            </tr>
          </thead>
          <tbody>
            <tr>
            <td style={{ fontSize: "18px" }}>Maximum</td>
              <td style={{ fontSize: "10px" }}>{response.max_temp}</td>
              <td style={{ fontSize: "18px" }}>{response.time_max}</td>
            </tr>
            <tr>
            <td style={{ fontSize: "18px" }}>Minimum</td>
              <td style={{ fontSize: "18px" }}>{response.min_temp}</td>
              <td style={{ fontSize: "18px" }}>{response.time_min}</td>
            </tr>
          </tbody>
        </table>
      )}
    </div>
  );
}

export default Analysis;
